import Fetch from "./dataFetch"
import { GetRequest } from "./GetRequest"

export const synCode = async (saveHistory, result) => {
    await Fetch('/', 'POST', saveHistory, result)
    GetRequest.getHistory().then(data =>{
        const zeroHistory = data[0]
        console.log(zeroHistory)
    })
}
